import React from "react";
import styles from "./Icon.module.css";

import Image from "next/image";

export const Icon = () => {
  return (
    <div className={styles.icon}>
      <Image
        src="/menu-icon-sincuadro.svg"
        alt="PPPP"
        width={18}
        height={10}
        className={styles.objetiveFitCover}
      />

      <p>Arriba se encuentra una imagen</p>
    </div>
  );
};
